import React from 'react';

class Login extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: '',
            value:''
        };
    }
    handleChange = (e) => {
        e.preventDefault();
        let {name, value} = e.target;
        this.setState({
            [name]: value.toLowerCase()
        },
        console.log(name, value));
    };

    onSubmit = (e) => {
        e.preventDefault();
    };
    
    render() {
        return (
            <div>
                <form onSubmit={onSubmit}>
                    <input className={"d-none d-md-inline"} placeholder={"email"} onChange={(e) => handleChange(e)} name={"emailLogin"}
                           id="address"/>
                    <input className={"d-none d-md-inline"} onChange={(e) => handleChange(e)} name={"city"}>

                    </input>
                    <input type={"submit"} value={"save change"} className={"filterButton"} id={"submitButton"}/>

                </form>
            </div>
        )
    }
}

export default Login;
